import React from 'react'
import {BrowserRouter,Routes,Route } from 'react-router-dom';
import Home from './Home';
import Orders from './Orders';
const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Routes>
          <Route path="Home"element={<Home />}/>
          <Route path="/Orders"element={<Orders />}/>
          </Routes>
          </BrowserRouter>
    </div>
  )
}
export default App
